import React from "react";

const ParallaxItem = () => {
  return (
    <li className="shape shape3 rt-mouse-parallax" id="rt-parallax-instance-2">
      <div
        className="parallax-layer"
        data-depth="4.00"
        style={{
          transform: "translate3d(-42.4px, -17.7px, 0px) rotate(0.0001deg)",
          transformStyle: "preserve-3d",
          backfaceVisibility: "hidden",
          position: "relative",
          display: "block",
          left: "0px",
          top: "0px",
        }}
      >
        <img
          loading="lazy"
          decoding="async"
          width="208"
          height="90"
          src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/hero-shape-10.png"
          className="attachment-full size-full wp-image-3514"
          alt=""
        />
      </div>
    </li>
  );
};

export default ParallaxItem;
